import "./App.css";
import Todos from "./components/Todos";
import Todo from "./models/Todo";
function App() {

  const todos = [  
    new Todo("Learn Maths"),
    new Todo("Learn Economics"),
  ];


  return (
    <div>
      <Todos items={['learn economics', 'learn maths']} />
    </div>
  );
}

export default App;
